import App from './containers/App';
//import { robots } from './robots';
//import CardList from './cardList';


ReactDOM.createRoot(document.getElementById('root')).render(
  <React.StrictMode>
   <Fragment>
    <App />
    </Fragment>
  </React.StrictMode>
);

reportWebVitals();

